Function Get-ErrorInformation
{
    Param($Component)
          Write-Log -Message "Exception: $($Error[0].Exception.Message)" -severity 3 -component $Component          Write-Log -Message "ErrorID: $($Error[0].FullyQualifiedErrorId)" -severity 3 -component $Component          Write-Log -Message "ScriptLineNumber: $($Error[0].InvocationInfo.ScriptLineNumber)" -severity 3 -component $Component          Write-Log -Message "Message: $($Error[0].InvocationInfo.PositionMessage)" -severity 3 -component $Component
}

Function Create-ReportFolder
{
    If(-not (Test-Path "$Global:PATH\Reports")){
        Try{
            $Folder = New-Item -Name Reports -Force -Path $Global:PATH -ItemType Directory -ErrorAction Stop
        }
        Catch{
            Get-ErrorInformation -Component "Create-ReportFolder"
        }
    }
}

Function Read-Image
{
    Param($MainImage)

        $iconimageBytes = [Convert]::FromBase64String($MainImage)
        $ims = New-Object IO.MemoryStream($iconimageBytes, 0, $iconimageBytes.Length)
            $ims.Write($iconimageBytes, 0, $iconimageBytes.Length);
        $ReadImage = new-object System.Windows.Media.Imaging.BitmapImage
            $ReadImage.BeginInit()
            $ReadImage.StreamSource = $ims
            $ReadImage.EndInit()

    Return $ReadImage
}

Function Write-LoggingScreen
{
    Param(
         $LogText,
         $TextColor
         )
    

    $UserInterFace.RXT_LoggingScreen.Dispatcher.Invoke("Normal",[action]{
            $NewParagraph = New-Object System.Windows.Documents.Paragraph
            $NewParagraph.Margin = 0
            $NewParagraph.AddText("$LogText")
            $NewParagraph.Foreground = $TextColor
            $UserInterFace.RXT_LoggingScreen.Document.Blocks.Add($NewParagraph)
            $UserInterFace.RXT_LoggingScreen.ScrollToEnd()
    })
}

Function Write-Log
{

    PARAM(
         [String]$Message,
         [String]$Path = "$Global:PATH\PoshCAT.log",
         [int]$severity,
         [string]$component,
         [Switch]$NoScreen
         )

         $TimeZoneBias = Get-WmiObject -Query "Select Bias from Win32_TimeZone"
         $Date = Get-Date -Format "HH:mm:ss.fff"
         $Date2 = Get-Date -Format "MM-dd-yyyy"
         $Type = 1

         if($severity -eq 1){
            if(!$NoScreen){
                Write-LoggingScreen -LogText $Message -TextColor Black
            }
         }
         if($severity -eq 2){
            if(!$NoScreen){
            Write-LoggingScreen -LogText $Message -TextColor Green
            }
         }
         if($severity -eq 3){
            if(!$NoScreen){
            Write-LoggingScreen -LogText $Message -TextColor RED
            }
         }
         "<![LOG[$Message]LOG]!><time=$([char]34)$date+$($TimeZoneBias.bias)$([char]34) date=$([char]34)$date2$([char]34) component=$([char]34)$component$([char]34) context=$([char]34)$([char]34) type=$([char]34)$severity$([char]34) thread=$([char]34)$([char]34) file=$([char]34)$([char]34)>"| Out-File -FilePath $Path -Append -NoClobber -Encoding default
       
}
